import '../css/about.css'
function About() {
    return (
      <section className='section'>
        <div className="aboutmain">
          <h1 className='about'>Recrash to serwis internetowy który ma na celu ułatwienie znalezienie koszów do wyrzucania “specjalnych” śmieci. Te śmieci nie powinno wyrzucać do zwykłych koszy ale do specjalnych koszy, których lokalizacje można znaleźć np. na naszej mapie. To są śmieci typu: baterie, śmieci elektroniczne, itd. Nazwa “Recrash” to połączenie dwóch słów: recycle i trash [rec(ycle)(tr)ash].</h1>
        </div>
      </section>
    );
  }
  
export default About;
